import React from "react";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import ButtonBase from '@material-ui/core/ButtonBase';
import Button from '@material-ui/core/Button';
import Avatar from '@material-ui/core/Avatar';


const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  mainStyle: {
    padding: theme.spacing.unit * 2,
    margin: 5,
    maxWidth: '100%',
  },
  bigAvatar: {
    margin: 10,
    width: 60,
    height: 60,
  },
});

class Members extends React.Component{
    render(){
        const { classes, theme } = this.props;

  return (
    <Paper className={classes.paper}>
  <Grid container spacing={16}>
    <Grid item>
      <Avatar alt="Remy Sharp" src="https://hacktiv8.com/img/fox.png__vzu2vhp2VRX%2Bewg7J0bPlaAa9e377ae39495073d0e66db163fc8d9b" className={classes.bigAvatar} />
    </Grid>
    <Grid item xs={12} sm container>
      <Grid item xs container direction="column" spacing={16}>
        <Grid item xs>
          <Typography gutterBottom component="h6" variant="h6">
            Hacktive8 Meetup
          </Typography>
          <Typography gutterBottom color="textSecondary">
          Location  Jakarta Indonesia
          </Typography>
        <Typography gutterBottom color="textSecondary">
          Members 1,078
        </Typography>
        <Typography gutterBottom color="textSecondary">
          Organizers  Ardhy Wiranata
        </Typography>
        </Grid>
      </Grid>
      
    </Grid>
  </Grid>
</Paper>
    );
    }
}

export default withStyles(styles, { withTheme: true })(Members);
